import React, { Component } from 'react';
import "bulma/css/bulma.css";
import '../MainPage.css';
import { Route } from "react-router";
import imageOne from '../Images/Profile.JPG'
import family from '../Images/Family.JPG'

import Carousel, { Dots } from '@brainhubeu/react-carousel';
import Image from 'react-image-resizer';

class About extends Component {
  constructor(props) {
    super(props);
    this.state = {};
  }

  render() {
    return (
      <div class="card" style={{borderRadius:"2px"}}>

      <Carousel
        arrows
        infinite
        centered
      >
        <Image
          src={imageOne}
          height={ 240 }
        />
        <img src={imageOne} style={{width:"30%"}}/>
        <img src={family} style={{width:"30%"}}/>

      </Carousel>

      </div>
    );
  }
}

export default About;
